    "Miniature Nontoxic Nitrous Oxide-Propane (MINNOP) Propulsion Project",nt"tracking_summary":
    {ntt"total": 1,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T03:47:56.217232",nt"name": "miniature-nontoxic-nitrous-oxide-propane-minnop-propulsion-project",nt"isopen":
    true,nt"url": null,nt"notes": "ORBITEC proposes to develop the Miniature
    Nontoxic Nitrous Oxide-Propane (MINNOP) propulsion system, a small bipropellant
    propulsion system which we offer as an alternative to miniature hydrazine monopropellant
    thrusters for CubeSat-class spacecraft.  As compared to state-of-the-art hydrazine
    systems, MINNOP propulsion will provide significant increases in specific impulse
    (in bipropellant mode) and comparable levels of minimum impulse bit (in cold gas
    mode), and it will do so with a nontoxic, environmentally benign, self-pressurizing
    set of propellants.  In Phase I, we will focus on demonstrating the operation of
    the bipropellant thrust chamber, and ignition of that chamber within appropriate
    weight constraints.  Our preliminary propulsion system design is intended to occupy
    1U of a 3U-size CubeSat.",nt"license_title": "U.S. Government Work",nt"extras":
